#include <iostream>
using namespace std;
class Solution {
public:
    bool isSubsequence(string s, string t) {
            int before =-1;
            for(int i = 0;i<s.size();i++){
                bool isRight = false;
                for(int j = before+1;j<t.size();j++){
                    if(t[j]==s[i]){
                        before = j;
                        isRight = true;
                        break;
                    }
                }
                if(!isRight)return false;
            }
            return true;

    }
};
int main() {
    string s  ="leeeeetcode";
      string t = "";
    std::cout << "Hello, World!"<<Solution().isSubsequence(s,t) << std::endl;
    return 0;
}